import React from "react";

const TitleBar = ({ showBackButton }) => {
  return (
    <div className="flex items-center justify-between bg-blue-500 h-7 text-white font-['Cabin'] font-medium uppercase text-sm leading-6 py-2 px-4">
      {showBackButton && (
        <div className="cursor-pointer">
          {/* You can replace the content of the back button as needed */}
          {/* For now, I'm using an arrow character for illustration */}
         <div class="w-[60px] h-[30px] px-4 py-1.5 bg-green-600 rounded shadow justify-center items-center gap-2 inline-flex">
  <div class="text-center text-white text-sm font-medium font-['Roboto'] uppercase leading-normal tracking-tight">Back</div>
</div> <span className="text-white">&#8592; Back</span>
        </div>
      )}
      <div className="ml-auto">WELLNEST: MOOD TRACKING FEATURE</div>
    </div>
  );
};

export default TitleBar;
